import numpy as np
import cv2
from scipy.spatial import cKDTree
import math


# =========================
# 
# =========================

def resample_contour(contour, n=256):
    """
     n 
    """
    pts = np.asarray(contour, dtype=np.float64)

    # 
    if not np.allclose(pts[0], pts[-1]):
        pts = np.vstack([pts, pts[0]])

    seg_len = np.linalg.norm(np.diff(pts, axis=0), axis=1)
    acc_len = np.concatenate([[0], np.cumsum(seg_len)])
    total_len = acc_len[-1]

    target = np.linspace(0, total_len, n, endpoint=False)

    resampled = []
    j = 0
    for t in target:
        while acc_len[j + 1] < t:
            j += 1
        ratio = (t - acc_len[j]) / (acc_len[j + 1] - acc_len[j] + 1e-12)
        p = pts[j] * (1 - ratio) + pts[j + 1] * ratio
        resampled.append(p)

    return np.array(resampled)


def normalize_contour(contour):
    """
     + 
    """
    pts = contour.copy()
    pts -= pts.mean(axis=0)

    scale = np.sqrt((pts ** 2).sum(axis=1).mean())
    pts /= (scale + 1e-12)

    return pts


# =========================
# 
# =========================

def hu_moments(contour):
    cnt = contour.astype(np.float32).reshape(-1, 1, 2)
    m = cv2.moments(cnt)
    hu = cv2.HuMoments(m).flatten()
    hu = -np.sign(hu) * np.log10(np.abs(hu) + 1e-12)
    return hu


def hu_distance(hu1, hu2):
    return np.linalg.norm(hu1 - hu2)


# =========================
# 
# =========================

def convexity_ratio(contour):
    cnt = contour.astype(np.float32).reshape(-1, 1, 2)
    hull = cv2.convexHull(cnt)
    area = cv2.contourArea(cnt)
    hull_area = cv2.contourArea(hull)
    return area / (hull_area + 1e-12)


# =========================
# 
# =========================

def contour_distance(a, b):
    """
     a  b /Chamfer
    """
    tree = cKDTree(b)
    dists, _ = tree.query(a)
    return dists.max(), dists.mean()


# =========================
# 
# =========================

def contours_similar_allow_scale_no_protrusion(
    contour_a,
    contour_b,
    *,
    sample_points=256,
    hu_thresh=0.3,
    convexity_thresh=0.02,
    max_dist_thresh=0.01,
    mean_dist_thresh=0.003
):
    """
    
    - 
    - 
    """

    # 1. 
    a = resample_contour(contour_a, sample_points)
    b = resample_contour(contour_b, sample_points)

    # 2.  + 
    a = normalize_contour(a)
    b = normalize_contour(b)

    # 3. 
    hu_a = hu_moments(a)
    hu_b = hu_moments(b)
    if hu_distance(hu_a, hu_b) > hu_thresh:
        return False

    # 4. 
    if abs(convexity_ratio(a) - convexity_ratio(b)) > convexity_thresh:
        return False

    # 5. 
    max_d_ab, mean_d_ab = contour_distance(a, b)
    max_d_ba, mean_d_ba = contour_distance(b, a)

    max_d = max(max_d_ab, max_d_ba)
    mean_d = (mean_d_ab + mean_d_ba) * 0.5

    if max_d > max_dist_thresh:
        return False

    if mean_d > mean_dist_thresh:
        return False

